import React from "react";
import { Button, Container, Navbar, NavbarBrand } from "react-bootstrap";

const AppNavbar = () => {
  return (
    <Navbar>
      <Container className="Py">
        <NavbarBrand>
          <h1 className="fs-4">Where in the world?</h1>
        </NavbarBrand>
        <div className="dark-mode-option">
          <Button variant="white" className="capitallize">
            dark mode
          </Button>
        </div>
      </Container>
    </Navbar>
  );
};

export default AppNavbar;
